import React from "react";
import { Text, StyleSheet } from "react-native";

const Home = () => {
  return <Text style={styles.text}>HomeScreen</Text>;
};

const styles = StyleSheet.create({
  text: {
    fontSize: 30
  }
});

export default Home;
